import React, { Component } from 'react';

class Tracks extends Component {
    render() {

        let topten = [];
        let response = this.props.response;

        if(response !==null){
            for(let i=0 ; i<10 ; i++){
                topten.push(response.data.data[i]);
            }
    
            topten.forEach(function(item,index){
                console.log(item,index);
                let songname = item.title_short;
                console.log(songname,item.album.id);
            });
        }

        const showitems = () => {
            if(response !== null){
                topten.map(item =>{
                    return <h1 key={item.album.id}>{item.title_short}</h1>
                });
            }
        }

        let list = (<showitems />)

        return (
            <div>
                {showitems}
            </div>
        )
    }
}

export default Tracks
